function SubmitAdminLogin(){var b=$("#login_form").attr("action");if(b.indexOf("__AJAX=True")<0)b+="&__AJAX=True";b+="&rand="+new Date;var c=$("#AccountName").val(),d=$("#Password").val();if(c.length<=0){alert("Username can not be empty!");return false}$.post(b,{AccountName:c,Password:d,SubmitLogin:"True"},function(a){a=eval(a);var e=parseInt(a.Result),f=a.Data;alert(a.Message);e>0&&setTimeout(function(){location.href=f},300)});return false};
